  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Browns
  Park National Wildlife Refuge outlines Refuge accomplishments during the 1970 calendar
  year. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover conditions during the year. Wildlife- including
  migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
  mammals, raptors, fish, and reptiles- is also covered. The Refuge development and
  maintenance section discusses physical developments and vegetation control. Resource
  management is outlined; topics include grazing and haying. The public relations
  section of the report describes recreational uses, Refuge visitors, Refuge participation,
  hunting, violations, and safety. Items of interest and N-R forms are attached.\",\n\t\"owner_org\":
